    key: "1",
    children: [
      {
        type: "group",
        label: <Link to="/kids-shoes">Giày trẻ em</Link>,
        children: [
          {
            label: <Link to="/kids-shoes?feature=casual">Giày thường</Link>,
            key: "2",
          },
          {
            label: (
              <Link to="/kids-shoes?feature=runningshoes">Giày chạy bộ</Link>
